import './Item.css';
import RemoveIcon from '../Icons/RemoveIcon/RemoveIcon';

function Item({ item }) {
  return (
    <tr className="item" key={item.id}>
      <th className="table_th">{item.username}</th>
      <th className="table_th">{item.email}</th>
      <th className="table_th">{item.registration_date}</th>
      <th className="table_th">{item.rating}</th>
      <th className="table_th">
        <span>
          <RemoveIcon />
        </span>
      </th>
    </tr>
  );
}

export default Item;
